using System;
using System.Collections.Generic;
using System.IO;
using System.Linq;
using System.Text;

namespace CalameoDownloader
{
	class Program
	{
		static void Main(string[] args)
		{
			try
			{
				if (args.Length == 2)
					Execute(args[0], args[1]);
				else
					ShowHelp();
			}
			catch (CalameoException calameoException)
			{
				Console.WriteLine("Error: " + calameoException.Message);
#if DEBUG
				Console.WriteLine("*Fin*");
				Console.ReadLine();
#endif
			}
			catch (Exception exception)
			{
				Console.WriteLine(
					"Unexpected error: " 
					+ exception.GetType().Name 
					+ " = " 
					+ exception.Message);
				Console.Beep();
#if DEBUG
				Console.WriteLine("*Fin*");
				Console.ReadLine();
#endif
			}
		}

		private static void ShowHelp()
		{
			Console.WriteLine("CalameoDownloer SourceURLOrLocalFilename DestinationDirectory");
			Console.WriteLine("-If specifying a local file name CalameoDownloader will download each document in the list");
		}

		static void Execute(string sourceUrl, string destinationDirectory)
		{
			if (!Directory.Exists(destinationDirectory))
				throw new CalameoException("Destination directory does not exist");
			if (!File.Exists(sourceUrl))
				ExecuteSingleBook(sourceUrl, destinationDirectory);
			else
				ExecuteListOfBooks(sourceUrl, destinationDirectory);

#if DEBUG
			Console.WriteLine("*Fin*");
			Console.ReadLine();
#endif
		}

		static void ExecuteListOfBooks(string sourceUrlListFileName, string destinationDirectory)
		{
			using (var reader = File.OpenText(sourceUrlListFileName))
			{
				int bookNumber = 0;
				while (true)
				{
					bookNumber++;
					string url = reader.ReadLine();
					if (url == null)
						return;
					Console.WriteLine("Book number " + bookNumber.ToString());
					Console.WriteLine("Url - " + url);
					ExecuteSingleBook(url.Trim(), destinationDirectory);
					Console.WriteLine("===DONE===");
					Console.WriteLine();
				}
			}
		}

		static void ExecuteSingleBook(string sourceUrl, string destinationDirectory)
		{
			Console.WriteLine("Downloading source and extracting book code");
			string bookCode = BookCodeExtractor.GetBookCode(sourceUrl);
			Console.WriteLine("Book code: " + bookCode);
			Console.WriteLine("Downloading book information");
			var bookInfo = BookInfoRetriever.GetInfo(bookCode);
			Console.WriteLine("Book title: " + bookInfo.content.account.name);
			WriteBookInfo(
				sourceUrl: sourceUrl,
				bookInfo: bookInfo,
				destinationDirectory: destinationDirectory
			);
			DownloadBookPages(destinationDirectory, bookInfo);
		}


		static void WriteBookInfo(
			string sourceUrl,
			Api.RootObject bookInfo, 
			string destinationDirectory)
		{
			string bookKey = bookInfo.content.key;
			string infoFilePath = Path.Combine(destinationDirectory, bookKey + ".txt");
			using (var writer = File.CreateText(infoFilePath))
			{
				writer.WriteLine("Account: " + bookInfo.content.account.name);
				writer.WriteLine("Book name: " + bookInfo.content.name);
				writer.WriteLine("Source URL: " + sourceUrl);
			}
		}

		static void DownloadBookPages(string destinationDirectory, Api.RootObject bookInfo)
		{
			var booRetriever = new BookRetriever();
			booRetriever.GetPages(
				bookInfo: bookInfo,
				destinationDirectory: destinationDirectory,
				progress: (current, total) =>
				{
					Console.Write("Downloaded page {0} of {1}\r\n", current, total);
				}
			);
		}
	}

